import React from "react";
import "materialize-css";
import Questions from "src/app/components/questions/Questions";
import clsx from "clsx";
import styles from "src/app/logic/mainPage/MainPage.module.scss";

/**
 * Quiz page
 */
const Quiz: React.FC = () => {
  const questionClassName = clsx(styles.container);

  return (
    <section className={questionClassName}>
      <Questions />
    </section>
  );
};

export default Quiz;

const Button: React.FC = () => {
  const btnClassName = clsx(styles.btn);

  return (
    <div>
      <button
        className={btnClassName}
        type="button"
      >
        Button
      </button>
    </div>
  );
};
